import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <div className="footer">
        <h2 class="ui header">
          <img src="/images/avatar/large/patrick.png"/>
          Patrick
        </h2>
      </div>
    );
  }
}

export default Footer;
